import RunningMET from "../Formulas/RunningMET";

export default function Calculator(activity, time, timeUnit) {
    if(timeUnit === "hours"){
        time = time * 60
    }
  if (activity === "running") {
    return RunningMET(time);
  } else {
    return null;
  }
}
